const p = $input.first().json;
const c = p.config;
const costJpy = parseFloat(p.cost_price) || 0;
const weightKg = parseFloat(p.weight_kg) || 0.5;
const dest = p.dest_country;
let exchangeRate = c.exchange_rate_usd_jpy;
let vatRate = 0;
let shippingCostJpy = 0;
let dutyRate = 0.05;
if (['DE', 'FR', 'IT', 'ES', 'NL', 'BE', 'AT'].includes(dest)) {
  exchangeRate = c.exchange_rate_eur_jpy;
  vatRate = c.vat_rate_eu;
  shippingCostJpy = weightKg <= 0.5 ? 1500 : (weightKg <= 1 ? 2000 : 2500 + (weightKg - 1) * 800);
} else if (dest === 'GB') {
  exchangeRate = c.exchange_rate_gbp_jpy;
  vatRate = c.vat_rate_uk;
  shippingCostJpy = weightKg <= 0.5 ? 1800 : (weightKg <= 1 ? 2300 : 2800 + (weightKg - 1) * 900);
} else {
  shippingCostJpy = weightKg <= 0.5 ? 1200 : (weightKg <= 1 ? 1800 : 2200 + (weightKg - 1) * 700);
  vatRate = 0;
}
const exportCostJpy = costJpy + shippingCostJpy;
const exportCostForeign = exportCostJpy / exchangeRate;
const dutyAmount = exportCostForeign * dutyRate;
const subtotalWithDuty = exportCostForeign + dutyAmount;
const vatAmount = subtotalWithDuty * vatRate;
const totalImportCost = subtotalWithDuty + vatAmount;
const currentPrice = parseFloat(p.listing_price) || 0;
const ebayFee = currentPrice * c.ebay_fee_percent;
const paypalFee = currentPrice * c.paypal_fee_percent;
const totalFees = ebayFee + paypalFee;
const netProfit = currentPrice - totalImportCost - totalFees;
const profitMargin = currentPrice > 0 ? (netProfit / currentPrice) : 0;
const minPriceFor10Percent = totalImportCost / (1 - c.ebay_fee_percent - c.paypal_fee_percent - 0.10);
const recommendedPrice = Math.ceil(minPriceFor10Percent * 1.05 * 100) / 100;
return [{ json: { id: p.id, sku: p.sku, product_name: p.product_name, calculation: { cost_jpy: costJpy, shipping_jpy: shippingCostJpy, export_cost_jpy: exportCostJpy, exchange_rate: exchangeRate, export_cost_foreign: Math.round(exportCostForeign * 100) / 100, duty_rate: dutyRate, duty_amount: Math.round(dutyAmount * 100) / 100, vat_rate: vatRate, vat_amount: Math.round(vatAmount * 100) / 100, total_import_cost: Math.round(totalImportCost * 100) / 100, ebay_fee: Math.round(ebayFee * 100) / 100, paypal_fee: Math.round(paypalFee * 100) / 100, total_fees: Math.round(totalFees * 100) / 100 }, current_price: currentPrice, net_profit: Math.round(netProfit * 100) / 100, profit_margin: Math.round(profitMargin * 1000) / 10, recommended_price: recommendedPrice, is_profitable: profitMargin >= 0.05, update_prices: p.update_prices, dest_country: dest } }];

